import React from "react";
import 'bootstrap/dist/css/bootstrap.css';

export default function FundraisingProject(props) {
    return (
        <li>
            <div className="bg-light m-5 p-3 fpWrapper">
                <h2 className="p-3">{props.fp.title}</h2>
                <div className="p-3">{props.fp.description}</div>
                <div className="row p-3">
                    <div className="col-sm">{props.fp.founder.username}</div>
                    <div className="col-sm">Goal</div>
                    <div className="col-sm">DueDate</div>
                    <div className="col-sm">Current balance</div>
                </div>
                <div className="p-3">Tags</div>
            </div>
        </li>
    )
}
